import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { cartStore } from './CartStore';
import { usePopup } from './PopupProvider';
import './Stores.css';  // ייבוא קובץ ה-CSS

const VivinoMenu = () => {
  const navigate = useNavigate();
  const { setImages, setVisible } = usePopup();

  const menu = [
    { name: 'Spaghetti Carbonara', price: 50 ,images:["data:image/jpeg;base64,"]},
    { name: 'Penne Arrabbiata', price: 45,images:["data:image/jpeg;base64,"] },
    { name: 'Lasagna Bolognese', price: 60,images:["data:image/jpeg;base64,"] },
    { name: 'Gnocchi al Pesto', price: 55,images:["data:image/jpeg;base64,"] },
    { name: 'Fettuccine Alfredo', price: 50 ,images:["data:image/jpeg;base64,"]},
    { name: 'Ravioli Ricotta e Spinaci', price: 52 ,images:["data:image/jpeg;base64,"]},
    { name: 'Tagliatelle al Ragu', price: 58,images:["data:image/jpeg;base64,"] },
    { name: 'Tortellini alla Panna', price: 54 ,images:["data:image/jpeg;base64,"]},
    { name: 'Pappardelle ai Funghi', price: 56 ,images:["data:image/jpeg;base64,"]},
   { name: 'Pasta Rose', price: 62,images:["data:image/jpeg;base64,"] },
  ];

  const goToCart = () => {
    navigate('/cart');
  };

  const handleImage = (images) => {
    setVisible(true);
    setImages(images);
  };

  return (
    <div className="menu-container Vivino-menu-container">
      <h2>Vivino Menu</h2>
      <ul>
        {menu.map((item, index) => (
          <li key={index}>
            {item.name} - {item.price} ₪
            <div className="resButtons">
              {/* אם יש תמונות, הצג את כפתור הצפייה */}
              <button onClick={() => handleImage(item.images || [])}>צפה במוצר</button>
              <button onClick={() => cartStore.addItem(item)}>+</button>
            </div>
          </li>
        ))}
      </ul>
      <button className="go-to-cart-button" onClick={goToCart}>Go to Cart</button>
    </div>
  );
};

export default VivinoMenu;
